def jsonable_encoder(
    obj: Any,
    include: Set[str] = None,
    exclude: Set[str] = None,
    by_alias: bool = False,
    include_none: bool = True,
    custom_encoder: Dict[Type, Any] = None,
) -> Any:
    exclude = exclude or set()
    custom_encoder = custom_encoder or {}

    if isinstance(obj, BaseModel):
        if not obj.Config.json_encoders:
            return jsonable_encoder(
                obj.dict(
                    include=include,
                    exclude=exclude,
                    by_alias=by_alias
                ),
                include_none=include_none
            )
        else:
            return jsonable_encoder(
                obj.dict(
                    include=include,
                    exclude=exclude,
                    by_alias=by_alias
                ),
                include_none=include_none,
                custom_encoder=obj.Config.json_encoders
            )
    elif isinstance(obj, Enum):
        return obj.value
    elif isinstance(obj, (str, int, float, type(None))):
        return obj
    elif isinstance(obj, dict):
        return {
            jsonable_encoder(
                key,
                by_alias=by_alias,
                include_none=include_none,
                custom_encoder=custom_encoder
            ): jsonable_encoder(
                value,
                by_alias=by_alias,
                include_none=include_none,
                custom_encoder=custom_encoder
            )
            for key, value in obj.items()
            if value is not None or include_none
        }
    elif isinstance(obj, (list, set, frozenset, Generator, tuple)):
        return [
            jsonable_encoder(
                item,
                include=include,
                exclude=exclude,
                by_alias=by_alias,
                include_none=include_none,
                custom_encoder=custom_encoder
            )
            for item in obj
        ]
    else:
        if custom_encoder and type(obj) in custom_encoder:
            encoder = custom_encoder[type(obj)]
        else:
            # Handle other types here, for example:
            if isinstance(obj, bytes):
                return obj.decode('utf-8')
            else:
                raise ValueError(f"Type {type(obj)} is not serializable")
        return encoder(obj)
